import React from 'react';

function Footer() {
    return (
        <React.Fragment>
        <footer>
            <p>Made by <a href='http://jusridev.com'>Justinas</a></p>
            <a href='https://github.com/Justasrimavicius/microgoogol'>Github</a>

        </footer>
        <div className='footer-mobile'>
            <button className='mainPath-tab-btn-footer'><img src={require('../../Photos/mainPathIcon.png')}></img></button>
            <button className='mistakes-tab-btn-footer'><img src={require('../../Photos/mistakesIcon.png')}></img></button>
            <button className='shop-tab-btn-footer'><img src={require('../../Photos/shopIcon.png')}></img></button>
        </div>
        </React.Fragment>

    );
}

export default Footer;
